If $\frac{1}{5} \log_2 x = \sin (5 \pi x),$ then
\[-1 \le \frac{1}{5} \log_2 x \le 1.\]Then $-5 \le \log_2 x \le 5,$ so $\frac{1}{32} \le x \le 32.$

For $x \le 1,$ we count five points of intersection.

For $x > 1,$ on each interval of the form
\[\frac{2n}{5} \le x \le \frac{2n + 1}{5},\]where $n \ge 3,$ the function $\sin (5 \pi x)$ increases from 0 to 1, and then decreases from 1 to 0.  This portion of the graph of $\sin (5 \pi x)$ intersects the graph of $\frac{1}{5} \log_2 x$ as long as $\frac{2n + 1}{5} \le 32.$  The largest such $n$ is 79.

Thus, for each $n,$ $3 \le n \le 79,$ there are two additional points of intersection.  This gives us a a total of $5 + 2 \cdot (79 - 3 + 1) = \boxed{159}$ points of intersection.

