\[\frac{AO}{\sin 30^\circ} = \frac{AB}{\sin 120^\circ},\]so
\[AO = \frac{AB \sin 30^\circ}{\sin 120^\circ} = \frac{2}{\sqrt{3}} = \frac{2 \sqrt{3}}{3}.\]The radius of the blue circle is then
\[s = AO - 1 = \frac{2 \sqrt{3}}{3} - 1 = \frac{2 \sqrt{3} - 3}{3}.\][asy]
