&= (\cos \alpha + \cos \beta + \cos \gamma) + i (\sin \alpha + \sin \beta + \sin \gamma) \\
&= 1 + i.
\end{align*}Note that $|a| = |b| = |c| = 1.$  Then by the Triangle Inequality,
\[|a - (1 + i)| = |-b - c| \le |b| + |c| = 2.\]Thus, $a$ must lie in the disc centered at $1 + i$ with radius 2.  Also, $a$ must lie on the circle centered at 0 with radius 1.

