\begin{align*}
GM^2 &= |1 - m|^2 \\
&= (1 - m)(1 - \overline{m}) \\
&= 1 - m - \overline{m} + m \overline{m} \\
&= 1 - \frac{\omega + \omega^2 + \omega^4}{3} - \frac{\omega^6 + \omega^5 + \omega^3}{3} + \frac{2}{9} \\
&= \frac{11}{9} - \frac{\omega^6 + \omega^5 + \omega^4 + \omega^3 + \omega^2 + \omega}{3} \\
&= \frac{11}{9} + \frac{1}{3} \\
&= \frac{14}{9}.
