draw(O--3*I, Arrow3(6));
draw(O--3*J, Arrow3(6));
draw(O--3*K, Arrow3(6));
draw(P--(0,1.5,1),dashed);
draw(P--(2,0,1),dashed);
draw(P--(2,1.5,0),dashed);

label("$x$", 3.2*I);
label("$y$", 3.2*J);
label("$z$", 3.2*K);
label("$50$", (2,1.5,1/2), W);
